schemaDefinition: "create or replace view PLS_SALES_LIVE_BU_SECURITY(\n\tUSERID,\n\
  \tBUGROUP,\n\tBUGROUP_CC\n) as\nSELECT \"USERID\",\n       \"BUGROUP\",\n      \
  \ \"BUGROUP_CC\"\nFROM\n  (-- SEMANTIC LAYER BEGINS\nSELECT \"USERID\" as \"USERID\"\
  ,\n       \"BUGROUP\" as \"BUGROUP\",\n       \"BUGROUP_CC\" as \"BUGROUP_CC\"\n\
  \   FROM\n     (SELECT \"Projection_2\".\"USERID\" as \"USERID\",\n            \
  \ \"Projection_2\".\"BUGROUP\" as \"BUGROUP\",\n             \"Projection_2\".\"\
  BUGROUP_CC\" as \"BUGROUP_CC\"\n      FROM\n        (SELECT \"USERID\" as \"USERID\"\
  \n         FROM \"EDW_LS\".\"SALES_EM\".\"EM_SESSION_USER\"\n         WHERE (\"\
  USERID\") IS not NULL )\"Projection_1\"\n      INNER JOIN\n        (SELECT \"USERID\"\
  \ as \"USERID\",\n                \"BUGROUP\" as \"BUGROUP\",\n                \"\
  BUGROUP_CC\" as \"BUGROUP_CC\"\n         FROM EDW_LS.SALES_EM.TF_TBLPLSSLSPRODBU)\"\
  Projection_2\" ON \"Projection_1\".\"USERID\" = \"Projection_2\".\"USERID\")Join_1);"
